// AUTOHIRST - THE CRYPTOCURRENCY is a generative
// art project that uses code and blockchain technology to 
// create artworks that explore the relationship between value, 
// wealth, and art. This project is inspired by a well-known artist
// who has addressed similar themes in their work, but aims to offer a
// fresh and innovative perspective on these themes through the use of 
// generative art technology.

// By using code and algorithms to create these artworks,
// unique and original pieces are created that are not bound 
// by the limitations of traditional media. In contrast to some 
// traditional art practices, which can sometimes rely entirely on 
// the labor of others to create large pieces or collections of art, 
// these automated artworks are created entirely by code, requiring no 
// human intervention. This approach allows for a commentary on the 
// hypocrisy of wealthy artists who profit from NFT technology while 
// continuing to rely on the labor of others to create their art in this 
// ecosystem. This goes against the spirit of Web 3, which aims to empower 
// individuals and decentralize power. Many wealthy artists take advantage 
// of lesser known artists in different ways, and this collection is a 
// challenge to traditional power structures and encourages viewers to think 
// critically about the value systems that shape our society and the future of 
// the digital art space.

// The project generates an image over the span of 60 seconds. 
// As the end of the 60 seconds approaches, the code becomes increasingly 
// specific about the points it plots until it finishes the piece at the 
// 60-second mark.

// AUTOHIRST - THE CRYPTOCURRENCY, also uses a random phrase generator 
// to create a unique phrase for the title of each piece.  This random phrase 
// generator uses randomness provided by the fxrand function so each piece always 
// has a unique title paired with it, or a "seed phrase" if you will...

// The main purpose of the random phrase generator in this project is to inspire 
// thoughts and ideas based on the mainly crypto-related phrases it generates. 
// By providing a diverse range of phrases, the generator encourages users to think 
// creatively and come up with new ideas that are related to the world of cryptocurrency.
// In addition to inspiring creative and innovative ideas, the random phrase generator 
// in this project also aims to inject a bit of humor into the mix. The generator generates 
// a wide range of phrases that are often comical or absurd, which can be a great 
// source of entertainment and enjoyment.

// To use the generator in your own projects, simply include the code in your project
// and call the generator function whenever you want to generate a new phrase. You can 
// customize the generator by adding your own lists of words or phrases to use as input, 
// or by modifying the generator function to suit your specific needs.

